import React from 'react';

import FeedShare from './FeedShare';
import FeedPost from './FeedPost';

import { Container } from './styles';

const MiddleColumn: React.FC = () => {
  return (<>
    <FeedShare />
    <FeedPost />
    <FeedPost />
    <FeedPost />
    <FeedPost />
    </>
  );
};

export default MiddleColumn;
